(1255, '_transient_dash_88ae138922fe95674369b1cb3d215a2b', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2016/03/wordpress-4-5-beta-3/''>WordPress 4.5 Beta 3</a> <span class="rss-date">March 10, 2016</span><div class="rssSummary">WordPress 4.5 Beta 3 is now available! This software is still in development, so we don’t recommend you run it on a production site. Consider setting up a test site just to play with the new version. To test WordPress 4.5, try the WordPress Beta Tester plugin (you’ll want “bleeding edge nightlies”). Or you can [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''http://wptavern.com/when-contributing-to-wordpress-full-time-leads-to-burnout''>WPTavern: When Contributing to WordPress Full-Time Leads to Burnout</a></li><li><a class=''rsswidget'' href=''https://ma.tt/2016/03/addicted-to-distraction/''>Matt: Addicted to Distraction</a></li><li><a class=''rsswidget'' href=''http://wptavern.com/wordpress-global-translation-day-set-for-april-24-2016''>WPTavern: WordPress Global Translation Day Set for April 24, 2016</a></li></ul></div><div class="rss-widget"><ul><li class=''dashboard-news-plugin''><span>Popular Plugin:</span> <a href=''https://wordpress.org/plugins/ml-slider/'' class=''dashboard-news-plugin-link''>Meta Slider</a>&nbsp;<span>(<a href=''plugin-install.php?tab=plugin-information&amp;plugin=ml-slider&amp;_wpnonce=a93141e20b&amp;TB_iframe=true&amp;width=600&amp;height=800'' class=''thickbox'' title=''Meta Slider''>Install</a>)</span></li></ul></div>', 'no'),
