(2845, 188, 'content', '<h2>EH Talent connects brands with digital influencers</h2>\r\n<p style="margin-top: -15px;">We help businesses align with influencers specific to their industry and target market - to deliver relevant and engaging content. We also manage and develop our team of influencers, to streamline communication and help them build value.</p>\r\n\r\n<h2>EH Productions specialises in digital content production</h2>\r\n<p style="margin-top: -15px;">Specialising in social media, we help businesses craft engaging stories to best reach their audiences - through creative development, still photography, video content, copywriting, product placement and more.</p>\r\n<img class="alignnone size-full wp-image-214" style="margin-top: 30px;" src="http://localhost/eh_wordpress/wp-content/uploads/2016/03/MG_0907-Edit.jpg" alt="_MG_0907-Edit" width="1200" height="800" />'),
